import React, { useState } from "react";
import { FaEye, FaEyeSlash } from "react-icons/fa";

const Login = ({ history }) => { // Access history from props
  const [formData, setFormData] = useState({
    uname: "",
    pwd: "",
  });

  const [errors, setErrors] = useState({
    uname: "",
    pwd: "",
    loginError: "",
  });

  const [showPassword, setShowPassword] = useState(false);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData((prevState) => ({
      ...prevState,
      [name]: value,
    }));
    setErrors((prevErrors) => ({
      ...prevErrors,
      [name]: "",
      loginError: "",
    }));
  };

  const handleTogglePassword = () => {
    setShowPassword(!showPassword);
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    let valid = true;
    if (formData.uname.trim() === "") {
      setErrors((prevErrors) => ({
        ...prevErrors,
        uname: "Username is required.",
      }));
      valid = false;
    }
    if (formData.pwd.trim() === "") {
      setErrors((prevErrors) => ({
        ...prevErrors,
        pwd: "Password is required.",
      }));
      valid = false;
    }

    if (valid) {
      try {
        // Simulate API call
        const response = { ok: true }; // Assuming login is successful
        if (response.ok) {
          console.log("Login successful");
          history.push("/adminHome"); // Redirect to adminHome page on successful login
        } else {
          console.error("Login failed");
          setErrors((prevErrors) => ({
            ...prevErrors,
            loginError: "Invalid username or password.",
          }));
        }
      } catch (error) {
        console.error("Error logging in:", error);
        // Handle error
      }

      setFormData({
        uname: "",
        pwd: "",
      });
    }
  };

  return (
    <div className="container mt-5">
      <div className="row justify-content-center">
        <div className="col-md-6">
          <div className="card">
            <div className="card-body">
              <h2 className="card-title text-center mb-4">Login</h2>
              {errors.loginError && (
                <div className="alert alert-danger" role="alert">
                  {errors.loginError}
                </div>
              )}
              <form onSubmit={handleSubmit}>
                <div className="mb-3">
                  <label className="form-label" htmlFor="uname">
                    Username:
                  </label>
                  <input
                    type="text"
                    id="uname"
                    name="uname"
                    className="form-control"
                    value={formData.uname}
                    onChange={handleChange}
                  />
                  {errors.uname && (
                    <p className="text-danger">{errors.uname}</p>
                  )}
                </div>
                <div className="mb-3">
                  <label className="form-label" htmlFor="pwd">
                    Password:
                  </label>
                  <div className="input-group">
                    <input
                      type={showPassword ? "text" : "password"}
                      id="pwd"
                      name="pwd"
                      className="form-control"
                      value={formData.pwd}
                      onChange={handleChange}
                    />
                    <span
                      className="input-group-text"
                      style={{ cursor: "pointer" }}
                      onClick={handleTogglePassword}
                    >
                      {showPassword ? <FaEyeSlash /> : <FaEye />}
                    </span>
                  </div>
                  {errors.pwd && (
                    <p className="text-danger">{errors.pwd}</p>
                  )}
                </div>
                <div className="text-center">
                  <button type="submit" className="btn btn-primary">
                    Login
                  </button>
                </div>
              </form>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Login;
